import { Box, Grid } from '@mui/material';
import React, { useState, useEffect } from 'react'
import ProfileCrd from '../genericComponent/profile-card/ProfileCrd';


const UsersListing = () => {
    const [data, setData] = useState(null);

    useEffect(()=> {
        fetch('https://dummyjson.com/users').then((result)=>{
            result.json().then(res => {
                console.log("ðŸš€ ~ file: index.js:11 ~ result.json ~ res:", res.users)
                setData(res.users)
            })
        })
    }, [])

  return (
    <div>
      <h1>User Listing</h1>
      <Box sx={{ flexGrow: 1 }}>
        <Grid container spacing={2}>
          {data?.map((val, index) => (
            <Grid item xs={4} key={val.id}>
              <div style={{padding: '0', borderRadius: '0', boxShadow: 'none', height: '100%', display: 'grid'}}>
                  <ProfileCrd data={val} />
              </div>
            </Grid>
          ))}
        </Grid>
      </Box>
    </div>
  )
}

export default UsersListing
